// SPDX-License-Identifier: MIT
// DecentAPI - 2021
pragma solidity >= 0.5.16 < 0.9.0;
  
contract Polygonscan_Response {

    address admin;
    mapping (address => uint) index;
    address[] allowedAddresses;
    

    constructor()  {
        admin = msg.sender;
    }

    function addAllowedAddress(address _allowedAddress) external {
        if (msg.sender != admin) {
            revert('wrong owner, cant add address');
        }
        
        if (!isAddressAllowed(_allowedAddress)) {
            index[_allowedAddress] = allowedAddresses.length;
            allowedAddresses.push(_allowedAddress);
        }

    }
    
    function isAddressAllowed(address _uA) public view returns (bool) {
        
        if (index[_uA] > 0) {
            return true;
        }
        return false;
    }

    event PolygonscanData(
        string sender_address,
        string dataCID
    );

    function emitPolygonscanData(
        string calldata _sender_address,
        string calldata _dataCID

        ) external {

        if (!isAddressAllowed(msg.sender)) {
        revert('wrong address, cant emit');
        }

        emit PolygonscanData(
            _sender_address, 
            _dataCID
  
            );



    }

    


}
